import React from 'react';
import mylogo from './mylogo.jpg'

const Menu=()=>{

    return(
        <React.Fragment>
            <div className="menu-wrapper">
                {/* <img src={mylogo} alt="my icon" /> */}
                <div className='menu-items'>
                    <ol>
                        <li><a href="" ></a>  Home</li>
                        <li>Projects</li>
                        <li>Resume</li>
                        <li>About</li>
                        <li>Contact</li>
                    </ol>
                </div>
            </div>

        </React.Fragment>

    );

};

export default Menu;
